import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "./Home.css";
import { apiUrl } from "../axios";
import axios from "axios";
import img1 from "../assets/image/img1.jpg"; // Adjust the path to your image

export default function Home() {


  useEffect(() => {
    getDoctors();
  }, []);

  const getDoctors = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`${apiUrl}/doctors`);
      if (response.status === 200) {
        setDoctorList(response.data);
      }
    } catch (error) {
      console.log(error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div id="page-top">
      <header className="masthead">
        <div className="container d-flex justify-content-between">
          <div className="logo">
            <h3>Medical Store</h3>
          </div>
          <div className="actions d-flex align-items-center">
            <button className="btn btn-outline-primary mx-2">Sign up</button>
            <input
              type="text"
              className="form-control mx-2"
              placeholder="Search..."
              style={{ maxWidth: "200px" }}
            />
          </div>
        </div>
      </header>

      {/* Main Section */}
      <section className="hero">
        <div className="container d-flex justify-content-between align-items-center">
          <div className="hero-text">
            <h1>Online Medical Store</h1>
            <p className="lead">Your trusted source for medications</p>
            <a href="/more" className="btn btn-link">Read More</a>
          </div>
          <div className="hero-images">
            <img src={img1} alt="Hero" className="img-fluid" />
          </div>
        </div>
      </section>

      {/* Footer Links */}
      <footer className="mt-5">
        <div className="container text-center">
          <nav>
            <Link to="/contact">Contact</Link> | <Link to="/about">About</Link>
          </nav>
        </div>
      </footer>
    </div>
  );
}
